import React from "react";
import Navigation from "../components/Navigation";

const Home = () => {
  return (
    <div>
      <Navigation />

      <div className="hickingBackground">
        <div>
          <h1>
            IT' S TIME <br />
            FOR HIKING
          </h1>
          <i>LOREMIPSUM DOLOR</i>
        </div>
      </div>
    </div>
  );
};

export default Home;
